import React from "react";
import { useOutletContext } from 'react-router-dom'
import Navbar from "./Navbar";
function Buns(){

    const {data} = useOutletContext();






    return(
        <div>
        <Navbar/>
        {data.map((i)=>(
            <div key={i.id}>{i.name}</div>
        ))}
        </div>
    )
}
export default Buns;
